const reducerCity = (state, { type, element }) => {
    switch (type) {
        case 'INPUT_TYPE':
            const inputVal = element.target.value
            return inputVal
            break;
        default: return state
    }
}
export const reducerSelCity = (state, { type, payload }) => {
    switch (type) {
        case 'SELECT_CITY':
            return payload
            break
        default: return state
    }
}
export default reducerCity;
